import React from "react";
import { Link } from "react-router-dom";

import "../styles/Home.css";

const Home = () => {
  return (
    <div id="nav">
      <img src="../assets/logo.svg" />
      <Link to="/claim">Claim</Link>
      <Link to="/claim">Claim</Link>
    </div>
  );
};

export default Home;
